  [],\n\t\"revision_timestamp\": \"2016-07-27T22:46:27.944041\",\n\t\"name\": \"narrative-report-j-clark-salyer-national-wildlife-refuge-for-calendar-year-1967\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for J. Clark Salyer
  NWR outlines Refuge accomplishments during the 1967 calendar year. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, mammals, raptors, reptiles,
  fish, and disease- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, vegetation control, and wildfires. Resource
  management is outlined; topics include grazing, haying, and fur harvesting. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes recreational uses, Refuge visitors, Refuge
  participation, hunting, and violations. Items of interest, N-R forms, and photographs
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
